{"title":"[Mike] SPLOM","type":"vega","params":{"spec":"{
  "$schema": "https://vega.github.io/schema/vega/v3.3.1.json",
  "padding": 10,
  "config": {
    "axis": {
      "tickColor": "#ccc"
    }
  },
  "signals": [
    { "name": "chartSize", "value": 120 },
    { "name": "chartPad", "value": 0 },
    { "name": "chartStep", "update": "chartSize + chartPad" },
    { "name": "width", "update": "chartStep * 4" },
    { "name": "height", "update": "chartStep * 4" },
    {
      "name": "cell", "value": null,
      "on": [
        {
          "events": "@cell:mousedown", "update": "group()"
        },
        {
          "events": "@cell:mouseup",
          "update": "!span(brushX) && !span(brushY) ? null : cell"
        }
      ]
    },
    {
      "name": "brushX", "value": 0,
      "on": [
        {
          "events": "@cell:mousedown",
          "update": "[x(cell), x(cell)]"
        },
        {
          "events": "[@cell:mousedown, window:mouseup] > window:mousemove",
          "update": "[brushX[0], clamp(x(cell), 0, chartSize)]"
        },
        {
          "events": {"signal": "delta"},
          "update": "clampRange([anchorX[0] + delta[0], anchorX[1] + delta[0]], 0, chartSize)"
        }
      ]
    },
    {
      "name": "brushY", "value": 0,
      "on": [
        {
          "events": "@cell:mousedown",
          "update": "[y(cell), y(cell)]"
        },
        {
          "events": "[@cell:mousedown, window:mouseup] > window:mousemove",
          "update": "[brushY[0], clamp(y(cell), 0, chartSize)]"
        },
        {
          "events": {"signal": "delta"},
          "update": "clampRange([anchorY[0] + delta[1], anchorY[1] + delta[1]], 0, chartSize)"
        }
      ]
    },
    {
      "name": "down", "value": [0, 0],
      "on": [{"events": "@brush:mousedown", "update": "[x(cell), y(cell)]"}]
    },
    {
      "name": "anchorX", "value": null,
      "on": [{"events": "@brush:mousedown", "update": "slice(brushX)"}]
    },
    {
      "name": "anchorY", "value": null,
      "on": [{"events": "@brush:mousedown", "update": "slice(brushY)"}]
    },
    {
      "name": "delta", "value": [0, 0],
      "on": [
        {
          "events": "[@brush:mousedown, window:mouseup] > window:mousemove",
          "update": "[x(cell) - down[0], y(cell) - down[1]]"
        }
      ]
    },
    {
      "name": "rangeX", "value": [0, 0],
      "on": [
        {
          "events": {"signal": "brushX"},
          "update": "invert(cell.datum.x.data + 'X', brushX)"
        }
      ]
    },
    {
      "name": "rangeY", "value": [0, 0],
      "on": [
        {
          "events": {"signal": "brushY"},
          "update": "invert(cell.datum.y.data + 'Y', brushY)"
        }
      ]
    },
    {
      "name": "cursor", "value": "'default'",
      "on": [
        {
          "events": "[@cell:mousedown, window:mouseup] > window:mousemove!",
          "update": "'nwse-resize'"
        },
        {
          "events": "@brush:mousemove, [@brush:mousedown, window:mouseup] > window:mousemove!",
          "update": "'move'"
        },
        {
          "events": "@brush:mouseout, window:mouseup",
          "update": "'default'"
        }
      ]
    }
  ],

  "data": [
    {
      "name": "splom",
      "url": {
      "%context%": true,
      "%timefield%": "dateTime",
      "index": "mike_location*",
      "body": {
        "size": 10000,
        "_source": [
          "elevation_feet",
          "weather_temperature.temp",
          "weather_wind.speed",
          "weather_humidity",
          "weather_short_description"
        ]
      }
    },
    "format": {"property": "hits.hits"}
    },
    {
      "name": "fields",
      "values": ["_source.elevation_feet", "_source.weather_temperature.temp", "_source.weather_wind.speed", "_source.weather_humidity"]
    },
    {
      "name": "cross",
      "source": "fields",
      "transform": [
        { "type": "cross", "as": ["x", "y"] },
        { "type": "formula", "as": "xscale", "expr": "datum.x.data + 'X'" },
        { "type": "formula", "as": "yscale", "expr": "datum.y.data + 'Y'" }
      ]
    }
  ],

  "scales": [
    {
      "name": "groupx",
      "type": "band",
      "range": "width",
      "domain": {"data": "fields", "field": "data"}
    },
    {
      "name": "groupy",
      "type": "band",
      "range": [{"signal": "height"}, 0],
      "domain": {"data": "fields", "field": "data"}
    },
    {
      "name": "color",
      "type": "ordinal",
      "domain": {"data": "splom", "field": "_source.weather_short_description"},
      "range": "category"
    },

    {
      "name": "_source.elevation_feetX", "zero": false, "nice": true,
      "domain": {"data": "splom", "field": "_source.elevation_feet"},
      "range": [0, {"signal": "chartSize"}]
    },
    {
      "name": "_source.weather_temperature.tempX", "zero": false, "nice": true,
      "domain": {"data": "splom", "field": "_source.weather_temperature.temp"},
      "range": [0, {"signal": "chartSize"}]
    },
    {
      "name": "_source.weather_wind.speedX", "zero": false, "nice": true,
      "domain": {"data": "splom", "field": "_source.weather_wind.speed"},
      "range": [0, {"signal": "chartSize"}]
    },
    {
      "name": "_source.weather_humidityX", "zero": false, "nice": true,
      "domain": {"data": "splom", "field": "_source.weather_humidity"},
      "range": [0, {"signal": "chartSize"}]
    },

    {
      "name": "_source.elevation_feetY", "zero": false, "nice": true,
      "domain": {"data": "splom", "field": "_source.elevation_feet"},
      "range": [{"signal": "chartSize"}, 0]
    },
    {
      "name": "_source.weather_temperature.tempY", "zero": false, "nice": true,
      "domain": {"data": "splom", "field": "_source.weather_temperature.temp"},
      "range": [{"signal": "chartSize"}, 0]
    },
    {
      "name": "_source.weather_wind.speedY", "zero": false, "nice": true,
      "domain": {"data": "splom", "field": "_source.weather_wind.speed"},
      "range": [{"signal": "chartSize"}, 0]
    },
    {
      "name": "_source.weather_humidityY", "zero": false, "nice": true,
      "domain": {"data": "splom", "field": "_source.weather_humidity"},
      "range": [{"signal": "chartSize"}, 0]
    }
  ],

  "axes": [
    {
      "orient": "left", "scale": "_source.elevation_feetY", "minExtent": 25,
      "title": "Elevation", "tickCount": 5, "domain": false,
      "position": {"signal": "3 * chartStep"}
    },
    {
      "orient": "left", "scale": "_source.weather_temperature.tempY", "minExtent": 25,
      "title": "Temperature", "tickCount": 5, "domain": false,
      "position": {"signal": "2 * chartStep"}
    },
    {
      "orient": "left", "scale": "_source.weather_wind.speedY", "minExtent": 25,
      "title": "Wind Speed", "tickCount": 5, "domain": false,
      "position": {"signal": "1 * chartStep"}
    },
    {
      "orient": "left", "scale": "_source.weather_humidityY", "minExtent": 25,
      "title": "Humidity", "tickCount": 5, "domain": false
    },
    {
      "orient": "bottom", "scale": "_source.elevation_feetX",
      "title": "Elevation", "tickCount": 5, "domain": false,
      "offset": {"signal": "-chartPad"}
    },
    {
      "orient": "bottom", "scale": "_source.weather_temperature.tempX",
      "title": "Temperature", "tickCount": 5, "domain": false,
      "offset": {"signal": "-chartPad"}, "position": {"signal": "1 * chartStep"}
    },
    {
      "orient": "bottom", "scale": "_source.weather_wind.speedX",
      "title": "Wind Speed", "tickCount": 5, "domain": false,
      "offset": {"signal": "-chartPad"}, "position": {"signal": "2 * chartStep"}
    },
    {
      "orient": "bottom", "scale": "_source.weather_humidityX",
      "title": "Humidity", "tickCount": 5, "domain": false,
      "offset": {"signal": "-chartPad"}, "position": {"signal": "3 * chartStep"}
    }
  ],

  "legends": [
    {
      "fill": "color",
      "title": "Weather Description",
      "offset": 0,
      "encode": {
        "symbols": {
          "update": {
            "fillOpacity": {"value": 0.5},
            "stroke": {"value": "transparent"}
          }
        }
      }
    }
  ],

  "marks": [
    {
      "type": "rect",
      "encode": {
        "enter": {
          "fill": {"value": "#eee"}
        },
        "update": {
          "opacity": {"signal": "cell ? 1 : 0"},
          "x": {"signal": "cell ? cell.x + brushX[0] : 0"},
          "x2": {"signal": "cell ? cell.x + brushX[1] : 0"},
          "y": {"signal": "cell ? cell.y + brushY[0] : 0"},
          "y2": {"signal": "cell ? cell.y + brushY[1] : 0"}
        }
      }
    },
    {
      "name": "cell",
      "type": "group",
      "from": {"data": "cross"},

      "encode": {
        "enter": {
          "x": {"scale": "groupx", "field": "x.data"},
          "y": {"scale": "groupy", "field": "y.data"},
          "width": {"signal": "chartSize"},
          "height": {"signal": "chartSize"},
          "fill": {"value": "transparent"},
          "stroke": {"value": "#ddd"}
        }
      },

      "marks": [
        {
          "type": "symbol",
          "from": {"data": "splom"},
          "interactive": false,
          "encode": {
            "enter": {
              "x": {
                "scale": {"parent": "xscale"},
                "field": {"datum": {"parent": "x.data"}}
              },
              "y": {
                "scale": {"parent": "yscale"},
                "field": {"datum": {"parent": "y.data"}}
              },
              "fillOpacity": {"value": 0.5},
              "size": {"value": 36}
            },
            "update": {
              "fill": [
                {
                  "test": "!cell || inrange(datum[cell.datum.x.data], rangeX) && inrange(datum[cell.datum.y.data], rangeY)",
                  "scale": "color", "field": "_source.weather_short_description"
                },
                {"value": "#ddd"}
              ]
            }
          }
        }
      ]
    },
    {
      "type": "rect",
      "name": "brush",
      "encode": {
        "enter": {
          "fill": {"value": "transparent"}
        },
        "update": {
          "x": {"signal": "cell ? cell.x + brushX[0] : 0"},
          "x2": {"signal": "cell ? cell.x + brushX[1] : 0"},
          "y": {"signal": "cell ? cell.y + brushY[0] : 0"},
          "y2": {"signal": "cell ? cell.y + brushY[1] : 0"}
        }
      }
    }
  ]
}
"},"aggs":[]}

{"title":"[Mike] Weather Distribution","type":"vega","params":{"spec":"{
  $schema: https://vega.github.io/schema/vega-lite/v2.json
  data: {
    url: {
      %context%: true
      %timefield%: dateTime
      index: mike_location*
      body: {
        size: 10000
        _source: ["dateTime", "weather_short_description", "weather_temperature.temp"]
      }
    }
    format: {property: "hits.hits"}
  }
  transform: [
    {calculate: "toDate(datum._source['dateTime'])", as: "time"}
  ]
  mark: circle
  encoding: {
    x: {field: "time", type: "temporal", axis: {title: null}}
    y: {field: "_source.weather_short_description", type: "nominal", axis: {title: null}}
    size: {field: "_source.weather_temperature.temp", type: "quantitative", legend: null}
    color: {field: "_source.weather_short_description", type: "nominal", legend: null}
  }
}"},"aggs":[]}

{"title":"[Mike] Battery State v2.0","type":"vega","params":{"spec":"{
  # Schema indicates that this is Vega code
  $schema: https://vega.github.io/schema/vega/v3.0.json
  # All our data sources are listed in this section
  data: [
    {
      name: values
      # when url is an object, it is treated as an Elasticsearch query
      url: {
        index: mike_location*
        body: {
          aggs: {
            battery_state: {
              terms: {
                field: batteryState
                size: 5
              }
            }
          }
          query: {
            range: {
              @timestamp: {gte: "now-24h", lte: "now"}
            }
          }
          size: 0
        }
      }
  ]
  marks: [
    {
      type: image
      from: {data: "values"}
      encode: {
        enter:{
          url: { 
            value: "https://image.flaticon.com/icons/svg/179/179366.svg"
            }
        }
      }
    }
  ]
}"},"aggs":[]}
